import React from "react";
import { ServiceItem } from "./ServiceItem";

export function ServiceCard({ title, services, headerPadding = "px-3" }) {
  return (
    <article className="flex flex-col items-center self-stretch p-px my-auto bg-white rounded-lg border border-black border-solid min-h-[498px] min-w-60 shadow-[0px_1px_2px_rgba(0,0,0,0.05)] w-[312px]">
      <header className={`gap-2.5 self-stretch ${headerPadding} max-w-full text-2xl font-bold leading-none text-center text-white bg-red-600 rounded-lg min-h-14 w-[310px] max-md:px-5`}>
        {title}
      </header>
      <ul className="w-full">
        {services.map((service, index) => (
          <ServiceItem key={index} name={service} />
        ))}
      </ul>
    </article>
  );
}
